module.exports = "<particles [params]=\"myParams\" class=\"particles\"></particles>\n<div class=\"columns is-gapless no-margin\">\n  <div class=\"column is-half\">\n    <div class=\"box no-pad\">\n      <figure class=\"image is-square main-head-picture\">\n        <img src=\"assets/images/img1.jpg\">\n      </figure>\n    </div>\n  </div>\n  <div class=\"column is-half info\">\n    <div class=\"container head-container\">\n      <section class=\"name-container\">\n        <div class=\"name-content\">\n          <h1 class=\"title name-main\">{{ name }}</h1>\n          <div class=\"subtitle level skills is-mobile\">\n            <p class=\"level-item\">Film</p>\n            <img class=\"bullets level-item\" src=\"/assets/svgs/bullet.svg\" alt=\"\">\n            <p class=\"level-item\">Web</p>\n            <img class=\"bullets level-item\" src=\"/assets/svgs/bullet.svg\" alt=\"\">\n            <p class=\"level-item\">Design</p>\n            <img class=\"bullets level-item\" src=\"/assets/svgs/bullet.svg\" alt=\"\">\n            <p class=\"level-item\">Photo</p>\n          </div>\n        </div>\n      </section>\n      <!-- Switch below class to something more descriptive of the class. . .name content or something? -->\n      <section class=\"contstuff\">\n        <div class=\"cont-box\">\n          <h1 class=\"intro-text branded\">Hi there!</h1>\n          <br>\n          <p class=\"intro-content\">\n              Welcome to my site! This is where I keep records on all my projects. If you want to see what goes on in my head, check out my blog. If you’re a client and you want to check out my work, navigate over to the projects page.\n\n              Wanna know more about me? Just keep scrolling!\n\n          </p>\n          <button class=\"button is-outlined branded-button\" type=\"button\" name=\"button\">Contact</button>\n        </div>\n      </section>\n    </div>\n  </div>\n</div>\n\n<section ngsReveal class=\"section web-dev\">\n  <div class=\"skill-item\">\n    <div class=\"hero high-contrast-background\">\n      <div class=\"hero-body\">\n        <div class=\"container has-text-centered\">\n          <h1 class=\"title branded box-head pulse\">\n              I'm a web developer!\n          </h1>\n        </div>\n      </div>\n    </div>\n    <div class=\"columns skill-column\">\n        <div class=\"column is-half\">\n          <div class=\"content\">\n            <p class=\"skill-description\">\n              An interest in the Raspberry Pi introduced me to programming with Python which introduced me to web development with Django. I’ve been making websites ever since. Most recently, I’ve taken up blockchain development in the form of Ethereum DApp and smart contract development.\n            </p>\n          </div>\n        </div>\n        <div class=\"column is-half\">\n          <div class=\"badges\">\n            <img class=\"badge swing\" src=\"assets/svgs/angular.svg\"/><img class=\"badge swing\"src=\"assets/svgs/css.svg\"/><img class=\"badge swing\"src=\"assets/svgs/html.svg\" alt=\"\"><img class=\"badge swing\"src=\"assets/svgs/mongo.svg\" alt=\"\"><img class=\"badge swing\" src=\"assets/svgs/node.svg\" alt=\"\">\n          </div>\n        </div>\n      </div>\n    </div>\n</section>\n\n<section ngsReveal class=\"section Filmmaker\">\n  <div class=\"skill-item\">\n    <div class=\"hero high-contrast-background\">\n      <div class=\"hero-body\">\n        <div class=\"container has-text-centered\">\n          <h1 class=\"title branded box-head pulse\">\n              I'm a Filmmaker!\n          </h1>\n        </div>\n      </div>\n    </div>\n    <div class=\"columns skill-column\">\n        <div class=\"column is-half\">\n          <div class=\"content\">\n            <p class=\"skill-description\">\n              Filmmaking was perhaps my first passion. I have over 9 years of experience in several roles in film/video production. I generally specialize in post production, specifically editing and coloring, but I’ve done work in several other roles as well.            </p>\n          </div>\n        </div>\n        <div class=\"column is-half\">\n          <div class=\"badges film\">\n            <img class=\"badge swing\" src=\"assets/svgs/Premiere.svg\"/><img class=\"badge swing\"src=\"assets/svgs/AfterEffects.svg\"/><img class=\"badge swing\"src=\"assets/svgs/Resolve.svg\" alt=\"\"><img class=\"badge swing\"src=\"assets/svgs/Fusion.svg\" alt=\"\">\n          </div>\n        </div>\n      </div>\n    </div>\n</section>\n\n<section ngsReveal class=\"section designer\">\n  <div class=\"skill-item\">\n    <div class=\"hero high-contrast-background\">\n      <div class=\"hero-body\">\n        <div class=\"container has-text-centered\">\n          <h1 class=\"title branded box-head pulse\">\n              I'm a designer!\n          </h1>\n        </div>\n      </div>\n    </div>\n    <div class=\"columns skill-column\">\n        <div class=\"column is-half\">\n          <div class=\"content\">\n            <p class=\"skill-description\">\n              Aesthetics and the art of design is something I’ve always had an interest in. Being a designer plays a huge role in how I approach my web and film work, as well as any visual project that I’m involved with.\n            </p>\n          </div>\n        </div>\n        <div class=\"column is-half\">\n          <div class=\"badges\">\n            <img class=\"badge swing\" src=\"assets/svgs/illustrator.svg\"/><img class=\"badge swing\"src=\"assets/svgs/photoshop.svg\"/><img class=\"badge swing\"src=\"assets/svgs/sketch.svg\" alt=\"\"><img class=\"badge swing\"src=\"assets/svgs/xd.svg\" alt=\"\">\n          </div>\n        </div>\n      </div>\n    </div>\n</section>\n"

